import React, { Component } from 'react';

import "@blueprintjs/core/lib/css/blueprint.css";
import { Navbar, Alignment, Menu, MenuItem, MenuDivider, Button, Intent, NavbarGroup, ButtonGroup } from "@blueprintjs/core";
import { Popover2 } from "@blueprintjs/popover2";


class Employeers extends React.Component {

    constructor(props) {
        super(props);

        this.name = props.name;
        this.surename = props.surename;
        this.age = props.age;
        this.position = props.position;
    }

    employeers = [
        {
            name: 'Василий',
            surename: 'Петров',
            age: 32,
            position: 'Программист'
        },
        {
            name: 'Геннадий',
            surename: 'Семенов',
            age: 42,
            position: 'Продакт менеджер'
        },
        {
            name: 'Игорь',
            surename: 'Шишкин',
            age: 22,
            position: 'Сейлз менеджер'
        },
        {
            name: 'Авдотья',
            surename: 'Иванова',
            age: 52,
            position: 'Клининг менеджер'
        }
    ];


    render() {
        this.employeers.map((item, index) => {
            return (
                <div>
                    {this.props.employeers.map((employeer, index) => {
                        return(
                            <div>
                            <Employeers
                              name={this.employeers.name}
                              surename={this.employeers.surename}
                              age={this.employeers.age}
                              position={this.employeers.position}
                            />
                          </div>
                        );
                    })}
                </div>
            );
        });
    };
};

export default Employeers;
